import React from 'react';
import setProfileImage from './setProfileImage';

const clickMe = () => {
  onCLick = (e) => {
    <setProfileImage />;
  };

  return (
    <div>
      <button onClick={onCLick}>Click Me</button>
    </div>
  );
};

export default clickMe;
